import React from 'react';
import './mypage.css';

const Mypage = () => {
  return (
    <div className="mypage-container">
      <h2 className="mypage-title">마이페이지</h2>

      <div className="mypage-grid">
        {/* 사용자 정보 */}
        <div className="mypage-card">
          <h3 className="card-title">내 정보</h3>
          <p className="card-text">이름: 홍길동</p>
          <p className="card-text">이메일: hong@example.com</p>
        </div>

        {/* 설정 */}
        <div className="mypage-card">
          <h3 className="card-title">설정</h3>
          <button className="btn-primary">비밀번호 변경</button>
        </div>

        {/* 활동 */}
        <div className="mypage-card full-width">
          <h3 className="card-title">최근 활동</h3>
          <ul className="activity-list">
            <li>2025-04-06: 로그인</li>
            <li>2025-04-05: 게시물 작성</li>
            <li>2025-04-04: 댓글 작성</li>
          </ul>
        </div>
      </div>
    </div>
  );
};

export default Mypage;
